  - name: TEXT4000
    number: '6'
    value: 'On April 25, 2005 the Federal Election Commission entered into a Conciliation
      Agreement, MUR 5428, with the Republican Party of Arkansas. This Conciliation
      Agreement was the result of an audit by the Commission that found the Committee
      had violated sections of the Federal Election Campaign Act that resulted in
      changes to the  Committees FEC Reports for those periods. The audit covered
      the period January 1, 1999 through December 31, 2000. Two of the changes that
      resulted from the audit were to cash on hand and debts as of December 31, 2000.    In
      accordance with Section VI, Part 4 of the Conciliation Agreement the Committee
      was required to have an independent accounting or compliance firm conduct a
      compliance audit and review of the financial activity, records and FEC filings
      for a five year period  beginning with calendar year 2004 and submit a report
      of the audit findings to the Commission. The fifth and final audit and review
      has been submitted to the Commission.    Completion of the Committees requirements
      under this agreement has necessitated adjustments to be made on the current
      May Monthly Report (4/1/09 - 4/30/09). The beginning cash on hand balances have
      been adjusted and debts reported on Schedule D have been removed. Line 6.(a)
      Cash on Hand January 1, 2009 and 6.(b) Cash on Hand at Beginning of Reporting
      Period of the Summary Page of Receipts and Disbursements have been reduced by
      $69,313.73. The reported amounts now reflect actual cash on hand for the appropriate
      dates. The debts reported on Schedule D Debts and Obligations in the amount
      of $38,868.66 have been removed as they were all paid in the years 2001 and
      2002. The Committee had previously filed Amended FEC Form 3X Reports related
      to the Conciliation Agreement beginning with the period January 1, 2003. Due
      to a misunderstanding on the part of the Committee the above  adjustments were
      not properly made in the appropriate subsequent reporting periods.    All salaries
      and wages for employees who spent more than 25 percent of their compensated
      time on Federal Election Activity or activities in connection with a Federal
      election have been reported on Schedule B supporting Line 30(b) of the Detailed
      Summary Page. The salaries and wages for employees who spend 25 percent or less
      of  their compensated time on Federal Election Activity or activities in connection
      with a Federal election have been properly reported on either Schedule B supporting
      Line 21(b) of the Detailed Summary Page or Schedule H4 supporting Line 21(a)
      (i) and (ii) of the  Detailed Summary Page.  '
  - value: '

'
